import React from "react";

const AddUserForm = () => {
  return (
    <form>
      <label>Name</label>
      <input type="text" name="name" />
      <label>Username</label>
      <input type="text" name="username" />
      <button>Add new user</button>
    </form>
  );
};

export default AddUserForm;
